(defn parse [line]
  (let [[id x op y] (map read-string (str/split line #":?\s"))]
    [id (if (number? x) x (list op x y))]))

(defn p1 [ss]
  (let [db  (->> ss (str/split-lines) (map parse) (into {}))]
    (->> 'root db
      (clojure.walk/prewalk-replace db)
      (eval)
      (time))))

(assert (= 152 (p1 sample)))
(assert (= 353837700405464 (p1 input)))



(defn p2 [ss]
  (let [root   'root
        db     (->> ss str/split-lines (map parse) (into {}))
        db     (assoc db 'humn 'X)
        calc   (fn [form]
                 (cond
                   (number? form) form
                   (symbol? form) form
                   (seq? form) (let [[op x y] form]
                                 (cond
                                   (seq? x) form
                                   (seq? y) form
                                   (symbol? x) form
                                   (symbol? y) form
                                   :else ((eval op) x y)))
                   :else form))
        [left
         right] (->> root db
                  (clojure.walk/prewalk-replace db)
                  (rest)
                  (map #(walk/postwalk calc %)))
        [res todo] (if (number? left)
                     [left right]
                     [right left])]
    (loop [res  res
           expr todo]
      (blet [[op x y] expr]
        (cond
          (= expr 'X)
          res

          (or (= x 'X) (seq? x))
          (case op
            + (recur (- res y) x)
            - (recur (+ res y) x)
            * (recur (/ res y) x)
            / (recur (* res y) x))

          (or (= y 'X) (seq? y))
          (case op
            + (recur (- res x) y)
            - (recur (- x res) y)
            * (recur (/ res x) y)
            / (recur (/ x res) y))

          :else (throw (ex-info "foo" {})))))))

(= 301 (p2 sample))
(= 3678125408017 (p2 input))